import wx

class MyFrame(wx.Frame):

    def __init__(self, parent, id):
        wx.Frame.__init__(self, parent, id, u'英文单词提取', size=(300, 150))
        self.Centre()

        # 创建面板
        panel = wx.Panel(self)

        self.statictext = wx.StaticText(parent=panel, label='请点击OK键输入')
        # 添加按钮，绑定按钮
        b1 = wx.Button(parent=panel, id=10, label='OK', pos=(100, 60))
        self.Bind(wx.EVT_BUTTON, self.on_click, b1)


    def on_click(self, event):

        dlg = wx.TextEntryDialog(None, u"请在下面文本框中输入英文:", u"虎仔词典")
        if dlg.ShowModal() == wx.ID_OK:
            message = dlg.GetValue()  # 获取文本框中输入的值

# 字符转换以及提取陌生单词
            m = message.split()   # 指定分隔符号切片，多空格当一个空格
            mine = set(m)

            ysw = str(mine.intersection(ys))    # 交集结果转字符串
            ysw_set = set(mine.intersection(ys))    # set集合

            toefl = str(mine.intersection(tf))
            toefl_set = set(mine.intersection(tf))

            grw = str(mine.intersection(gre))
            grw_set = set(mine.intersection(gre))

            cets4 = str(mine.intersection(cet4))
            cets4_set = set(mine.intersection(cet4))

            cets = str(mine.intersection(cet6))
            cets_set = set(mine.intersection(cet6))

            myword = ysw_set | toefl_set | grw_set | cets_set | cets4_set
            d_cet6 = myword - cets_set
            d_cet4 = myword - cets4_set

            smyword = str(myword)
            cet4st = str(d_cet4)

           #对话框显示内容
            dlg_tip = wx.MessageDialog(None, cet4st, u"IELTS，TOEFL，GRE，CET6, CET4 词库删除CET4单词", wx.OK | wx.ICON_INFORMATION)
            if dlg_tip.ShowModal() == wx.ID_OK:
                self.Close(True)
            dlg_tip.Destroy()
        dlg.Destroy()

        # 陌生单词写入文本
        f_name = 'huzainet翻译.txt'

        with open(f_name, 'w', encoding='utf-8') as f:
            f.writelines('雅思单词:')
            f.writelines(ysw + '\n')
            f.writelines('托福单词:')
            f.writelines(toefl + '\n')
            f.writelines('美国研究生入学考试:')
            f.writelines(grw + '\n')
            f.writelines('CET6单词:')
            f.writelines(cets + '\n')
            f.writelines('CET4单词:')
            f.writelines(cets4 + '\n')
            f.writelines('数据库所有单词:')
            f.writelines(smyword + '\n')
class App(wx.App):
    def OnInit(self):
        # 创建窗口对象  程序启动时，使用，初始化
        frame = MyFrame(parent=None, id=-1)
        frame.Show()
        return True

if __name__ == "__main__":
    app = App()
    app.MainLoop()  # 进入主事件循环



